import {
    appbarHeight
} from '../masterStyle.js';

const dashboardStyle = theme => ({
    container: {
        height: "100%",
        marginTop: "2rem",
        [theme.breakpoints.up('sm')]: {
            marginTop: appbarHeight,
        }
    },
    title: {
        padding: "1.5rem"
    },
});

export default dashboardStyle;
